import AuthUser from './AuthUser';

export default function Dashboard() {
    const {user} = AuthUser();

    return(
        <div class="container p-3 my-3 bg-dark text-white">
            <h4>Nombre :</h4> <p>{user.name}</p>            
            <h4>Email :</h4><p>{user.email}</p>      
            </div>      
    )
}
